Необычайно функциональный процессор. Моделирование лучших усилителей, кабинетов и звукоснимателей, а также арсенал эффектов студийного качества. RP50 оснащен DSP-чипом AudioDNA™ для гарантии того, что и моделирование, и эффекты будут на мировом уровне. 24-битное A/Ц/A преобразование препятствует потерям частотной характеристики между входами и выходами. Простой интерфейс, драм-машина с 30 шаблонами и 13-светодиодный тюнер.

Характеристики процессора эффектов для электрогитары Digitech RP50:
Программы: 80 (40 заводских + 40 пользовательских);
А/Ц преобразование: 24 bit;
Ц/А преобразование: 24 bit;
Модули эффектов: 22;
Максимум эффектов одновременно: 10;
Вес: 1 кг.

Состояние нового. Интересует в первую очередь обмен на педали перегруза, преампы с доплатой в обе стороны.

