Это прибор, который применяется при изготовлении самогона и получения дистиллированной воды. За счет спиралевидной формы внутренней трубки, дистиллятор имеет намного большую площадь охлаждаемой поверхности. Пары проходят больший путь и охлаждаются гораздо быстрее. Благодаря этому повышается производительность дистиллятора. Дистиллятор ДИАС является одним из лучших приборов среди подобных на сегодняшнем рынке.

Особенности дистиллятора ДИАС

Для работы прибора необходимо наличие проточной воды;

Всі частини дистилятора ДІАС виготовлені з термостійкого скла, що дозволяє витримати робочі температури процесу дистиляції;

Можливість отримати дистильовану воду в побутових умовах без застосування промислових дистиляторів
